INSERT INTO saga VALUES (1, 'Star Wars', 'Saga conformada por 9 peliculas que narra las aventuras de Luke Skywalker, Han Solo, Princesa Leia, Chewbacca, R2-D2 y C-3PO en una galaxia muy muy lejana.' 1977, 'Universo original creado por George Lucas');
INSERT INTO saga VALUES (2, 'Harry Potter', 'Harry Potter es una saga de siete peliculas que narra las aventuras de un joven mago llamado Harry Potter y sus amigos Hermione Granger y Ron Weasley, todos estudiantes de la Escuela de Magia y Hechiceria de Hogwarts.', 2001, 'Basada en los libros escritos por J.K. Rowling');
INSERT INTO saga VALUES (3, 'Jurassic Park', 'La saga de Jurassic Park cuenta con tres peliculas de ciencia ficcion y terror que se centran en el escape de dinosaurios prehistoricos de un parque tematico.', 1993, 'Basada en las novelas escritas por Michael Crichton');
INSERT INTO saga Values (4, 'Monsterverse', 'La saga de Monsterverse es una serie de peliculas de ciencia ficcion y terror que se centran en los monstruos de la mitologia japonesa.', 2014, 'Universo original creado por Legendary Pictures');
INSERT INTO saga VALUES (5, 'Piratas del Caribe', 'La saga de Piratas del Caribe es una serie de peliculas de accion y aventura que se centran en el pirata Jack Sparrow y sus aventuras en alta mar.', 2003, 'Universo original creado Ted Elliott y Terry Rossio');
INSERT INTO saga VALUES (6, 'Las Crónicas de Narnia', 'La saga de Las Crónicas de Narnia es una serie de peliculas de aventura y fantasia que se centran en los hermanos Pevensie y sus aventuras en el mundo de Narnia.', 2005, 'Basada en las novelas escritas por C.S. Lewis');
INSERT INTO saga VALUES (7, 'El Caballero Oscuro', 'La saga del Caballero Oscuro es una serie de peliculas de accion y aventura que se centran en el super heroe Batman y sus aventuras en Gotham City.',2005, 'Basada en los comics de DC Comics');
INSERT INTO saga VALUES (8, 'Como Entrenar a tu Dragon', 'Trilogia de peliculas de animacion que se centran en el joven vikingo Hipo y su encuentro y amistad con un dragon.', 2010, 'Basada en la serie de libros de Cressida Cowell');
INSERT INTO macroserie VALUES(1, 'Cancion de Hielo y Fuego', 'Escrita por George R.R. Martin. Las series se centran en los acontecimientos que ocurren en Poniente, un continente ficticio que se asemeja a Europa medieval.', 2011, 'Basada en los libros escritos por George R.R. Martin');
INSERT INTO macroserie VALUES(2, 'The Boys', 'Universo compuesto de dos series y una proxima a estrenarse. Las series se centran en un grupo de super heroes que se han vuelto corruptos y violentos.', 2019, 'Basada en los comics de Garth Ennis');
INSERT INTO macroserie VALUES(3, 'The Defenders', 'Universo compuesto de seis series. Las series se centran en los super heroes de Marvel Comics que se unen para combatir a los villanos de la ciudad de Nueva York.', 2015, 'Basada en los comics de Marvel');
INSERT INTO macroserie VALUES(4, 'Vikings', 'Escrita por Michael Hirst. Las series se centran en la vida de Ragnar Lodbrok, un vikingo que se convierte en rey de Dinamarca.', 2013, 'Inspirada en la vida de Ragnar Lodbrok');
INSERT INTO macroserie VALUES(5, 'American Horror Story', 'Antologia de series de terror que se centran en diferentes historias de terror a lo largo de la historia de Estados Unidos.', 2011, 'Universo original creado por Ryan Murphy');
INSERT INTO docuserie VALUES(1, 'En pocas palabras', 'Los documentales relatan una variedad de problemas que impactan la vida de las personas como la ética de la ingeniería genética, la desigualdad racial y la monogamia.' 2018, 'Documentales originales de Netflix');
INSERT INTO docuserie VALUES(2, 'Cosmos', 'Los documentales se centran en la historia de la humanidad y la evolucion de la vida en la Tierra.', 1980, 'Documentales originales de Carl Sagan');
INSERT INTO docuserie VALUES(3, 'Discovery', 'Documentales que se centran en la naturaleza y la vida salvaje.', 1985, 'Documentales originales de Discovery Channel');
