INSERT INTO pelicula VALUES (1, 'US', 1, 'Star Wars: Episodio I - La amenaza fantasma', 'El joven Anakin Skywalker se convierte en aprendiz de Jedi y se enfrenta a la amenaza de la Confederación de Sistemas Independientes.', 1999, 'Lucasfilm Ltd.', 'PG-13', 136, 0);
INSERT INTO pelicula VALUES (2, 'US', 1, 'Star Wars: Episodio II - El ataque de los clones', 'Anakin Skywalker y Obi-Wan Kenobi se enfrentan a un ejército de clones mandados por el malvado Señor Sith, Darth Sidious.', 2002, 'Lucasfilm Ltd.', 'PG-13', 142, 0);
INSERT INTO pelicula VALUES (3, 'US', 1, 'Star Wars: Episodio III - La venganza de los Sith', 'La guerra civil entre los Jedi y los Sith se intensifica. Mientras tanto, el joven Anakin Skywalker se debate entre el bien y el mal.', 2005, 'Lucasfilm Ltd.', 'PG-13', 140, 0);
INSERT INTO pelicula VALUES (4, 'US', 1, 'Star Wars: Episodio IV - Una nueva esperanza', 'Luke Skywalker, un joven granjero, se enfrenta a la amenaza de la Estrella de la Muerte, una estación espacial de la Federación Galáctica.', 1977, 'Lucasfilm Ltd.', 'PG', 121, 0);
INSERT INTO pelicula VALUES (5, 'US', 1, 'Star Wars: Episodio V - El imperio contraataca', 'Han Solo y Luke Skywalker, acompañados por la princesa Leia, intentan evitar que el Imperio Galáctico destruya la Alianza Rebelde.', 1980, 'Lucasfilm Ltd.', 'PG', 124, 0);
INSERT INTO pelicula VALUES (6, 'US', 1, 'Star Wars: Episodio VI - El retorno del Jedi', 'Han Solo, Luke Skywalker y la princesa Leia intentan derrotar al malvado Emperador Palpatine y a Darth Vader.', 1983, 'Lucasfilm Ltd.', 'PG', 131, 0);
INSERT INTO pelicula VALUES (7, 'US', 1, 'Star Wars: Episodio VII - El despertar de la fuerza', 'Luke Skywalker ha desaparecido. Una nueva amenaza surge para la galaxia. Rey, una joven huérfana, y Finn, un exsoldado, se unen a Han Solo y Chewbacca en una aventura para encontrar a Luke y restaurar la paz.', 2015, 'Lucasfilm Ltd.', 'PG-13', 135, 0);
INSERT INTO pelicula VALUES (8, 'US', 1, 'Star Wars: Episodio VIII - Los últimos Jedi', 'Rey, Finn y Poe Dameron se unen a Luke Skywalker en una aventura para salvar a la galaxia de la tiranía del malvado Líder Supremo Snoke y su ejército de soldados de asalto.', 2017, 'Lucasfilm Ltd.', 'PG-13', 152, 0);
INSERT INTO pelicula VALUES (9, 'US', 1, 'Star Wars: Episodio IX - El ascenso de Skywalker', 'Rey, Finn y Poe Dameron se unen a Luke Skywalker, Leia Organa y Chewbacca en una aventura para restaurar la paz y la justicia en la galaxia.', 2019, 'Lucasfilm Ltd.', 'PG-13', 142, 0);
INSERT INTO pelicula VALUES (10, 'US', 1, 'Rogue One: Una historia de Star Wars', 'Spin-off de la saga Star Wars que narra la historia de los rebeldes que robaron los planos de la Estrella de la Muerte.', 2016, 'Lucasfilm Ltd.', 'PG-13', 133, 0);
INSERT INTO pelicula VALUES (11, 'US', 1, 'Han Solo: Una historia de Star Wars', 'Spin-off de la saga Star Wars que narra las aventuras de Han Solo antes de conocer a Luke Skywalker y a Obi-Wan Kenobi.', 2018, 'Lucasfilm Ltd.', 'PG-13', 135, 0);
INSERT INTO pelicula VALUES (12, 'UK', 2, 'Harry Potter y la piedra filosofal', 'Harry Potter es un niño huérfano que vive con sus malvados tíos y su cruel primo. Un día, un mitad-gigante llamado Hagrid le comunica que es un mago y que ha sido aceptado en Hogwarts, una escuela de magia.', 2001, 'Warner Bros.', 'PG', 152, 0);
INSERT INTO pelicula VALUES (13, 'UK', 2, 'Harry Potter y la cámara secreta', 'Harry Potter regresa a Hogwarts para comenzar su segundo año de estudios. Allí, junto a sus amigos Ron y Hermione, descubrirá que alguien ha abierto la Cámara de los Secretos, un lugar maldito que guarda un terrible secreto.', 2002, 'Warner Bros.', 'PG', 161, 0);
INSERT INTO pelicula VALUES (14, 'UK', 2, 'Harry Potter y el prisionero de Azkaban', 'El tercer año de estudios de Harry en Hogwarts se ve amenazado por la fuga de Sirius Black de la prisión de Azkaban', 2004, 'Warner Bros.', 'PG', 141, 0);
INSERT INTO pelicula VALUES (15, 'UK', 2, 'Harry Potter y el caliz de fuego', 'Harry Potter es elegido para participar en el Torneo de los Tres Magos, en la que deberá luchar contra dragones, internarse en el agua y enfrentarse a sus mayores miedos.', 2005, 'Warner Bros.', 'PG', 157, 0);
INSERT INTO pelicula VALUES (16, 'UK', 2, 'Harry Potter y la orden del fénix', 'Harry defenderá a Hogwarts de Lord Voldemort, quien ha regresado más poderoso que nunca.', 2007, 'Warner Bros.', 'PG-13', 138, 0);
INSERT INTO pelicula VALUES (17, 'UK', 2, 'Harry Potter y el misterio del príncipe', 'Harry Potter y sus amigos Ron y Hermione se embarcan en una peligrosa misión para descubrir el misterio que rodea a Lord Voldemort.', 2009, 'Warner Bros.', 'PG-13', 153, 0);
INSERT INTO pelicula VALUES (18, 'UK', 2, 'Harry Potter y las reliquias de la muerte: Parte 1', 'Harry, Ron y Hermione se embarcan en una peligrosa misión para destruir el Horrocrux que Voldemort ha creado.', 2010, 'Warner Bros.', 'PG-13', 146, 0);
INSERT INTO pelicula VALUES (19, 'UK', 2, 'Harry Potter y las reliquias de la muerte: Parte 2', 'La batalla final entre Harry Potter y Lord Voldemort se acerca. Mientras tanto, Harry y sus amigos se preparan para lo que será su último año en Hogwarts.', 2011, 'Warner Bros.', 'PG-13', 130, 0);
INSERT INTO pelicula VALUES (20, 'UK', 2, 'Animales fantásticos y dónde encontrarlos', 'El magizoólogo Newt Scamander llega a Nueva York en 1926 con una maleta llena de criaturas mágicas.', 2016, 'Warner Bros.', 'PG-13', 133, 0);
INSERT INTO pelicula VALUES (21, 'UK', 2, 'Animales fantásticos: Los crímenes de Grindelwald', 'El magizoólogo Newt Scamander regresa a Nueva York para enfrentarse a un poderoso mago oscuro.', 2018, 'Warner Bros.', 'PG-13', 134, 0);
INSERT INTO pelicula VALUES (22, 'UK', 2, 'Animales fantásticos: Los secretos de Dumbledore', 'Grindelwald es libre y se ha aliado con otros magos oscuros para levantar un ejército de seres mágicos. Dumbledore y Newt Scamander se unen para detenerlo.', 2022, 'Warner Bros.', 'PG-13', 134, 0);
INSERT INTO pelicula VALUES (23, 'US', 3, 'Parque Jurásico', 'Un grupo de científicos y un multimillonario crean un parque temático con dinosaurios clonados.', 1993, 'Universal Pictures', 'PG-13', 127, 0);
INSERT INTO pelicula VALUES (24, 'US', 3, 'Parque Jurásico: El mundo perdido', 'La isla Sorna mantiene dinosaurios en libertad. Ian Malcolm debe rescatar a su familia de la isla.', 1997, 'Universal Pictures', 'PG-13', 129, 0);
INSERT INTO pelicula VALUES (25, 'US', 3, 'Parque Jurásico III', 'Allan Grant regresa a Nublar, pero deberá enfrentarse a un nuevo peligro.', 2001, 'Universal Pictures', 'PG-13', 92, 0);
INSERT INTO pelicula VALUES (26, 'US', 3, 'Mundo Jurásico', 'El parque temático Jurassic World se ha convertido en un éxito mundial. Sin embargo, un nuevo dinosaurio genéticamente modificado amenaza con destruirlo todo.', 2015, 'Universal Pictures', 'PG-13', 124, 0);
INSERT INTO pelicula VALUES (27, 'US', 3, 'Mundo Jurásico: El reino caído', 'Un grupo de dinosaurios se ha escapado de Jurassic World y amenaza con destruir todo a su paso.', 2018, 'Universal Pictures', 'PG-13', 128, 0);
INSERT INTO pelicula VALUES (28, 'US', 3, 'Mundo Jurásico: Dominion', 'Los dinosaurios son libres en el continente, un conflicto entre humanos y dinosaurios se avecina.', 2022, 'Universal Pictures', 'PG-13', 128, 0);
INSERT INTO pelicula VALUES (29, 'US', 4, 'Kong: La isla calavera', 'Un grupo de exploradores se adentra en una isla misteriosa, pero no se imaginan que Kong, un gorila gigante, los está esperando.', 2017, 'Warner Bros.', 'PG-13', 118, 0);
INSERT INTO pelicula VALUES (30, 'US', 4, 'Godzilla', 'Una pareja de monstruos radioactivos se enfrentan con Godzilla. MONARCH, una organización que estudia a los monstruos, intenta detenerlos.', 2014, 'Warner Bros.', 'PG-13', 123, 0);
INSERT INTO pelicula VALUES (31, 'US', 4, 'Godzilla: El rey de los monstruos', 'La humanidad despierta a King Ghidorah, un monstruo que amenaza con destruir a la humanidad. Godizilla deberá enfrentarse con su viejo enemigo.', 2019, 'Warner Bros.', 'PG-13', 132, 0);
INSERT INTO pelicula VALUES (32, 'US', 4, 'Godzilla vs Kong', 'Godzilla y Kong se enfrentan en una batalla épica.', 2023, 'Warner Bros.', 'PG-13', 132, 0);
INSERT INTO pelicula VALUES (33, 'US', 5, 'Piratas del Caribe: La maldición de la Perla Negra', 'Jack Sparrow, un pirata, debe recuperar la Perla Negra, un tesoro que le ha sido arrebatado.', 2003, 'Walt Disney Pictures', 'PG-13', 143, 0);
INSERT INTO pelicula VALUES (34, 'US', 5, 'Piratas del Caribe: El cofre del hombre muerto', 'Jack Sparrow debe recuperar el cofre del hombre muerto, un cofre que contiene un peculiar tesoro.', 2006, 'Walt Disney Pictures', 'PG-13', 150, 0);
INSERT INTO pelicula VALUES (35, 'US', 5, 'Piratas del Caribe: En el fin del mundo', 'Los piratas deben navegar hasta el fin del mundo para salvar a su capitán.', 2007, 'Walt Disney Pictures', 'PG-13', 169, 0);
INSERT INTO pelicula VALUES (36, 'US', 5, 'Piratas del Caribe: En mareas misteriosas', 'La fuente de la juventud crea un conflicto entre piratas.', 2011, 'Walt Disney Pictures', 'PG-13', 136, 0);
INSERT INTO pelicula VALUES (37, 'US', 5, 'Piratas del Caribe: La venganza de Salazar', 'Jack Sparrow debe enfrentarse con el capitán Salazar, un pirata que busca venganza.', 2017, 'Walt Disney Pictures', 'PG-13', 129, 0);
INSERT INTO pelicula VALUES (38, 'NZ', 6, 'Las crónicas de Narnia: El león, la bruja y el armario', 'Cuatro hermanos se adentran en un armario y descubren un mundo mágico.', 2005, 'Walt Disney Pictures', 'P', 143, 0);
INSERT INTO pelicula VALUES (39, 'US', 6, 'Las crónicas de Narnia: El príncipe Caspian', 'Los hermanos Pevensie regresan a Narnia para ayudar a Caspian a recuperar su trono.', 2008, 'Walt Disney Pictures', 'G', 150, 0);
INSERT INTO pelicula VALUES (40, 'US', 6, 'Las crónicas de Narnia: La travesía del viajero del alba', 'Los hermanos Pevensie regresan a Narnia para ayudar a un viajero del alba a encontrar el camino de vuelta a su hogar.', 2010, 'Walt Disney Pictures', 'G', 169, 0);
INSERT INTO pelicula VALUES (41, 'US', 7, 'Batman Begins', 'Bruce Wayne se adentra en el mundo del crimen para combatirlo.', 2005, 'Warner Bros.', 'PG-13', 136, 0);
INSERT INTO pelicula VALUES (42, 'US', 7, 'El caballero oscuro', 'Batman debe enfrentarse con el Joker, un criminal que quiere destruir a Gotham.', 2008, 'Warner Bros.', 'PG-13', 129, 0);
INSERT INTO pelicula VALUES (43, 'US', 7, 'El caballero oscuro: La leyenda renace', 'Batman debe enfrentarse con Bane, un criminal que quiere destruir a Gotham.', 2012, 'Warner Bros.', 'PG-13', 143, 0);
INSERT INTO pelicula VALUES (44, 'US', 8, 'Como entrenar a tu dragón', 'Un joven vikingo se encuentra con un Furia Nocturna, un misterioso dragón que resulta ser más amigable de lo que parece.', 2010, 'DreamWorks Animation', 'G', 150, 0);
INSERT INTO pelicula VALUES (45, 'US', 8, 'Como entrenar a tu dragón 2', 'Hipo y Chimuelo se enfrentan a un cazador de dragones, que controla a un poderoso dragón gigante.', 2014, 'DreamWorks Animation', 'G', 102, 0);
INSERT INTO pelicula VALUES (46, 'US', 8, 'Como entrenar a tu dragón 3', 'Chimuelo e Hipo se encuentran con la mayor amenaza que han enfretado hasta ahora.', 2019, 'DreamWorks Animation', 'G', 104, 0);
INSERT INTO serie VALUES (1, 'US', 1, 'Juego de Tronos', 'En la lucha por el trono de hierro, los siete reinos de Poniente y muchas más casas se disputarán la corona.', 2011, 8, 'R', 0);
INSERT INTO serie VALUES (2, 'US', 1, 'House of the Dragon', 'La historia de la Casa Targaryen, una de las casas más poderosas de Poniente.', 2022, 1, 'R', 1);
INSERT INTO serie VALUES (3, 'US', 2, 'The Boys', 'Los superhéroes abusan de sus superpoderes en lugar de usarlos para el bien, y unos "muchachos" se embarcan en una búsqueda heroica para exponer sus secretos.', 2019, 3, 'R', 0);
INSERT INTO serie VALUES (4, 'US', 2, 'The Boys: Diábolico', 'Historias cortas animadas, emocionalmente impactantes e irreverentes, ambientadas en el universo de superhéroes de "The Boys".', 2022, 1, 'R', 0);
INSERT INTO serie VALUES (5, 'US', 3, 'Marvel - Daredevil', 'Ciego desde que era joven, Matt Murdock lucha contra la injusticia de día como abogado y por la noche como Daredevil en Nueva York.', 2015, 3, 'PG-13', 1);
INSERT INTO serie VALUES (6, 'US', 3, 'Marvel - The Punisher', 'Un exmarine se ve envuelto en una conspiración militar mientras trata de castigar a las personas responsables de los asesinatos de los miembros de su familia.', 2017, 2, 'PG-13', 1);
INSERT INTO serie VALUES (7, 'US', 3, 'Marvel - Luke Cage', 'Luke Cage, un ex convicto con una fuerza sobrehumana y una piel irrompible que ahora lucha contra el crimen y la corrupción.', 2016, 2, 'PG-13', 1);
INSERT INTO seire VALUES (8, 'US', 3, 'Marvel - Iron Fist', 'Danny Rand regresa a Nueva York después de estar desaparecido durante años, pero su regreso no es lo que esperaba.', 2017, 2, 'PG-13', 1);
INSERT INTO serie VALUES (9, 'US', 3, 'Marvel - Jessica Jones', 'Jessica Jones, una ex superheroína, se dedica a investigar casos de superhéroes que han caído en desgracia.', 2015, 3, 'PG-13', 1);
INSERT INTO serie VALUES (10, 'US', 3, 'Marvel - The Defenders', 'Cuatro superhéroes se unen para combatir a los villanos más peligrosos de Nueva York.', 2017, 1, 'PG-13', 1);
INSERT INTO serie VALUES (11, 'US', 4, 'Vikings', 'La vida de Ragnar Lodbrok, un legendario vikingo que se convirtió en el rey de Dinamarca.', 2013, 6, 'R', 0);
INSERT INTO serie VALUES (12, 'US', 4, 'Vikings: Valhalla', 'La historia de Ragnar y su familia, desde su llegada a Francia hasta su muerte.', 2022, 1, 'R', 0);
INSERT INTO serie VALUES (13, 'US', 5, 'American Horror Story: Murder House', 'Una familia se muda a una casa embrujada y descubre que sus habitantes anteriores no se fueron voluntariamente.', 2011, 1, 'R', 1);
INSERT INTO serie VALUES (14, 'US', 5, 'American Horror Story: Asylum', 'En 1964, en el asilo psiquiátrico Briarcliff, Nueva Inglaterra, el personal y los pacientes serán victimas de horribles experimentos.', 2012, 1, 'R', 1);
INSERT INTO serie VALUES (15, 'US', 5, 'American Horror Story: Coven', 'Más de 300 años han pasado desde los días turbulentos de los juicios de Salem y las brujas que lograron escapar ahora se encuentran en peligro de extinción.', 2013, 1, 'R', 1);
INSERT INTO serie VALUES (16, 'US', 5, 'American Horror Story: Freak Show', 'En la aldea de Jupiter, Florida, en 1952, acaba de llegar a la ciudad un grupo de freaks, que coincide con la extraña aparición de un asesino que amenaza la vida de los habitantes.', 2014, 'R', 1);
INSERT INTO serie VALUES (17, 'US', 5, 'American Horror Story: Hotel', 'En el enigmático hotel Cortez en Los Angeles, California el detective John Lowe trata de encontrar la verdad sobre una serie de asesinatos.', 2015, 1, 'R', 1);
INSERT INTO serie VALUES (18, 'US', 5, 'American Horror Story: Roanoke', 'Una pareja se muda a Carolina del Norte, cerca de la casa hay un bosque donde habitan los fantasmas de Thomasin White, la líder de la colonia perdida de Roanoke.', 2016, 1, 'R', 1);
INSERT INTO serie VALUES (19, 'US', 5, 'American Horror Story: Cult', 'La ciudad ficticia de Brookfield Heights, Michigan, queda dividida por las elecciones presidenciales de Estados Unidos de 2016.', 2017, 1, 'R', 1);
INSERT INTO serie VALUES (20, 'US', 5, 'American Horror Story: Apocalypse', 'En un futuro cercano, misiles nucleares destruyen el mundo y comienza un invierno nuclear. Gracias al avión privado de su familia, Coco St. Pierre Vanderbilt logra escapar de la destrucción de Los Ángeles.', 2018, 1, 'R', 1);
INSERT INTO serie VALUES (21, 'US', 5, 'American Horror Story: 1994', 'En el Campamento Redwood, a las afueras de Los Ángeles, hace muchos años se produjeron varios crimines en manos de Mr. Jigles. El asesino enserie regresa para causar daños a todos los que se han acercado al sitio.', 2019, 1, 'R', 1);
INSERT INTO serie VALUES (22, 'US', 5, 'American Horror Story: Double Feature', 'Un escritor con problemas, su mujer embarazada y su hija se mudan a un pueblo costero aislado para pasar el invierno. Una vez están asentados, los verdaderos habitantes del pueblo se dan a conocer.', 2021, 2, 'R', 1);
INSERT INTO serie VALUES (23, 'US', 5, 'American Horror Story: NYC', 'Durante un aumento en el número de muertes y desapariciones misteriosas en Nueva York, un médico descubre algo aterrador, mientras que un reportero local aparece en los titulares al día siguiente.', 2022, 1, 'R', 1);
INSERT INTO serie VALUES (24, 'US', null, 'The Walking Dead', 'Ambientada en un mundo post-apocalíptico repleto de zombis, llamados caminantes, un grupo de supervivientes debe de luchar por su vida frente a la plaga de estos y los peligros de otros grupos de humanos hostiles.', 2010, 11, 'R', 0);
INSERT INTO serie VALUES (25, 'US', null, 'The Big Bang Theory', 'Cuatro amigos, dos de ellos físicos y dos de ellos informáticos, viven en Pasadena, California. Sheldon, Leonard, Howard y Raj son los protagonistas de esta serie que nos muestra la vida de estos cuatro amigos que comparten piso.', 2007, 12, 'PG', 0);
INSERT INTO serie VALUES (26, 'US', null, 'The Simpsons', 'La familia Simpson, compuesta por Homer, Marge, Bart, Lisa y Maggie, es una familia de clase media que vive en la ciudad de Springfield. La serie se centra en la vida de esta familia, sus problemas y sus aventuras.', 1989, 30, 'PG', 0);
INSERT INTO serie VALUES (27, 'US', null, 'Breaking Bad', 'Un profesor de química, Walter White, es diagnosticado con un cáncer de pulmón en estado terminal. Para asegurar el futuro de su familia, acepta unirse a un antiguo alumno suyo, Jesse Pinkman, para fabricar y vender metanfetamina.', 2008, 5, 'R', 0);
INSERT INTO serie VALUES (28, 'US', null, 'Better Call Saul', 'La serie se centra en la vida de Jimmy McGill, un abogado que se dedica a defender a los más desfavorecidos, antes de convertirse en Saul Goodman, el abogado de Walter White en Breaking Bad.', 2015, 6, 'R', 0);
INSERT INTO serie VALUES (29, 'US', null, 'Black Mirror', 'Black Mirror es una serie de televisión británica de ciencia ficción y antología, creada por Charlie Brooker. Cada episodio de la serie se centra en una historia diferente, con diferentes actores, y diferentes escenarios.', 2011, 5, 'R', 0);
INSERT INTO serie VALUES (30, 'US', null, 'Love, Death & Robots', 'Love, Death & Robots es una serie de animación de antología de ciencia ficción y fantasía creada por Tim Miller y David Fincher para Netflix. La serie está compuesta por trece episodios de media hora cada uno, que se estrenaron el 15 de marzo de 2019.', 2019, 1, 'R', 0);
INSERT INTO serie VALUES (31, 'US', null, 'The Witcher', 'The Witcher es una serie de televisión de fantasía estadounidense basada en la serie de novelas de fantasía épica de Andrzej Sapkowski.', 2019, 2, 'R', 0);
INSERT INTO serie VALUES (32, 'US', null, 'The Umbrella Academy', 'The Umbrella Academy es una serie de televisión estadounidense de superhéroes basada en la serie de cómics homónima de Gerard Way y Gabriel Bá.', 2019, 3, 'R', 0);
INSERT INTO serie VALUES (33, 'US', null, 'Friends', 'Friends es una serie de televisión estadounidense de comedia creada por Marta Kauffman y David Crane. La serie sigue las vidas de seis amigos en la ciudad de Nueva York.', 1994, 10, 'PG-13', 0);
INSERT INTO serie VALUES (34, 'US', null, 'The Office', 'The Office es una serie de televisión estadounidense de comedia basada en la serie británica homónima. La serie sigue las vidas de los empleados de la oficina de Dunder Mifflin en Scranton, Pensilvania.', 2005, 9, 'R', 0);
INSERT INTO serie VALUES (35, 'US', null, 'Suits', 'Suits es una serie de televisión estadounidense de drama legal creada por Aaron Korsh. La serie sigue a un joven abogado llamado Mike Ross, quien comienza a trabajar como abogado en una de las mejores firmas de abogados de Manhattan, mientras sigue estudiando para obtener su título de abogado.', 2011, 9, 'R', 0);
INSERT INTO serie VALUES (36, 'US', null, 'Stranger Things', 'Stranger Things es una serie de televisión estadounidense de ciencia ficción y terror creada por los hermanos Duffer. La serie sigue a un grupo de niños en la ciudad ficticia de Hawkins, Indiana, que se enfrentan a fuerzas sobrenaturales mientras investigan el desaparecimiento de uno de sus compañeros.', 2016, 4, 'R', 0);
INSERT INTO serie VALUES (37, 'DE', null, 'Dark', 'Dark es una serie de televisión alemana de ciencia ficción y misterio creada por Baran bo Odar y Jantje Friese. La serie sigue a varias familias de la ciudad de Winden, Alemania, que se enfrentan a una serie de misterios relacionados con viajes en el tiempo, experimentos científicos secretos, y la reaparición de un niño desaparecido.', 2017, 3, 'R', 0);
INSERT INTO serie VALUES (38, 'US', null, '13 Reasons Why', '13 Reasons Why es una serie de televisión estadounidense de drama adolescente basada en la novela homónima de Jay Asher. La serie sigue a un grupo de adolescentes que se enfrentan a la vida después de que una de sus compañeras de clase comete suicidio.', 2017, 4, 'R', 0);
INSERT INTO serie VALUES (39, 'DE', null, '1899', '1899 es una serie de televisión alemana de drama histórico creada por Baran bo Odar y Jantje Friese. La serie sigue a un grupo de jóvenes que se enfrentan a la vida en el Imperio alemán durante la Primera Guerra Mundial.', 2022, 1, 'R', 0);
INSERT INTO serie VALUES (40, 'US', null, 'Transformers Prime', 'Transformers Prime es una serie de televisión estadounidense de animación creada por Jeff Kline. La serie sigue a un grupo de autobots liderados por Optimus Prime, que se enfrentan a una serie de villanos liderados por Megatron.', 2010, 3, 'PG-13', 0);
INSERT INTO documental VALUES (1, 'US', 1, 'En pocas palabras', 'En pocas palabras es un documental estadounidense de 2018 dirigido por Morgan Neville. El documental sigue a la escritora y activista Gloria Steinem, quien se convirtió en una figura clave en la lucha por los derechos de las mujeres en los Estados Unidos.', 2018, 2, 'PG-13', 1);
INSERT INTO documental VALUES (2, 'US', 1, 'La mente, en pocas palabras', 'Desde los sueños hasta los trastornos de ansiedad, se explora lo que sucede dentro del cerebro.', 2019, 2, 'PG-13', 1);
INSERT INTO documental VALUES (3, 'US', 1, 'El sexo, en pocas palabras', 'Desde la biología de la atracción hasta la historia del control de la natalidad, una exploración de los secretos del sexo.', 2020, 1, 'R', 1);
INSERT INTO documental VALUES (4, 'US', 1, 'El poder del voto, en pocas palabras', 'Los temores de que el proceso de votación sea manipulado por poderosos donantes y corporaciones, la manipulación, el Colegio Electoral, la supresión de votantes, el fraude en las urnas y las formas en que se cuentan los votos.', 2020, 1, 'PG-13', 1);
INSERT INTO documental VALUES (5, 'US', 1, 'El dinero, en pocas palabras', 'Desde la historia del dinero hasta la historia de la banca, se explora lo que sucede cuando el dinero se mueve.', 2021, 1, 'PG-13', 1);
INSERT INTO documental VALUES (6, 'US', 2, 'Cosmos: Un viaje personal', 'Cosmos: Un viaje personal es un documental estadounidense de 1980 dirigido por Carl Sagan. El documental sigue a Carl Sagan en su viaje por el espacio y el tiempo, explorando la historia del universo. ', 1980, 1, 'PG', 1);
INSERT INTO documental VALUES (7, 'US', 2, 'Cosmos: Una odisea de espacio y tiempo', 'Serie documental estadounidense de 2014 dirigida por Ann Druyan y Steven Soter. La serie sigue a Neil deGrasse Tyson en su viaje por el espacio y el tiempo, explorando la historia del universo.', 2014, 1, 'PG', 1);
INSERT INTO documental VALUES (8, 'US', 3, 'Supervivencia al desnudo', 'Supervivencia al desnudo es un documental estadounidense de Discovery. El documental sigue a un grupo de personas que se enfrentan a la vida en la naturaleza sin comida, agua, ropa o herramientas.', 2004, 1, 'PG-13', 1);
INSERT INTO documental VALUES (9, 'US', 3, 'El mundo de los dinosaurios', 'El mundo de los dinosaurios es un documental estadounidense Discovery. El documental hace un recorrido por la historia de los dinosaurios.', 2000, 1, 'PG-13', 1);
INSERT INTO documental VALUES (10, 'US', 3, 'Mayday: Accidentes aéreos', 'Mayday: Accidentes aéreos es un documental estadounidense de Discovery, y relata los accidentes aéreos más importantes de la historia.', 2000, 1, 'PG-13', 1);
INSERT INTO documental VALUES (10, 'CA', 3, 'Alaska: La última frontera', 'Alaska: La última frontera es un documental estadounidense de Discovery, y relata la vida de los habitantes de Alaska.', 2000, 1, 'PG-13', 1);
INSERT INTO documental VALUES (11, 'US', null, 'Prehistoric Planet', 'Prehistoric Planet es un documental dirigido por Apple TV+, y cuenta la vida y comportamiento de los dinosaurios.', 2022, 1, 'PG-13', 1);
INSERT INTO documental VALUES (12, 'US', null, 'The Last Dance', 'The Last Dance es un documental dirigido por ESPN, y cuenta la vida y carrera de Michael Jordan.', 2020, 1, 'PG-13', 1);
INSERT INTO documental VALUES (13, 'US', null, 'Cowspiracy: The Sustainability Secret', 'Cowspiracy: The Sustainability Secret es un documental dirigido por Netflix, y cuenta la historia de la industria de la carne.', 2014, 1, 'PG-13', 1);
INSERT INTO documental VALUES (14, 'US', null, 'The Social Dilemma', 'The Social Dilemma es un documental dirigido por Netflix, y cuenta la historia de las redes sociales.', 2020, 1, 'PG-13', 1);
INSERT INTO documental VALUES (15, 'US', null, 'The Game Changers', 'The Game Changers es un documental dirigido por Netflix, y cuenta la historia de la alimentación de los atletas.', 2019, 1, 'PG-13', 0);
INSERT INTO documental VALUES (16, 'US', null, 'Libranos del mal', 'Libranos del mal narra la historia de los abusos sexuales en la Iglesia Católica.', 2006, 1, 'PG-13', 0);
INSERT INTO documental VALUES (17, 'US', null, 'The Pharmacist', 'The Pharmacist narra la historia de la industria farmacéutica.', 2019, 1, 'PG-13', 0);
INSERT INTO documental VALUES (18, 'UK', null, 'Paseando con dinosaurios', 'Un programa que explora la vida de estos extraordinarios animales.', 1999, 1, 'PG-13', 0);
INSERT INTO documental VALUES (19, 'US', null, 'El misterio de Marilyn Monroe: Las cintas inéditas.', 'Documental que explora el misterio de la muerte del icono del cine Marilyn Monroe a través de entrevistas inéditas con su círculo más cercano.', 2022, 1, 'PG-13', 1);
INSERT INTO documental VALUES (20, 'US', null, 'Shoah', 'Documental que explora la historia de los judíos durante la Segunda Guerra Mundial.', 1985, 1, 'PG-13', 1);
INSERT INTO documental VALUES (21, 'US', null, 'O.J. Made in America', 'Documental que explora la vida de O.J. Simpson.', 2016, 1, 'PG-13', 1);
INSERT INTO documental VALUES (22, 'US', null, 'Wild Wild Country', 'Documental que explora la historia de la secta Rajneesh y su impacto en la comunidad de Antelope, Oregon.', 2018, 1, 'PG-13', 1);
INSERT INTO documental VALUES (23, 'US', null, 'The Staircase', 'Documental que explora el caso de Michael Peterson, un escritor que fue acusado de asesinar a su esposa.', 2004, 1, 'PG-13', 1);
INSERT INTO documental VALUES (24, 'US', null, 'The Keepers', 'Documental que explora el caso de la muerte de la monja católica Sister Cathy Cesnik.', 2017, 1, 'PG-13', 1);
INSERT INTO documental VALUES (25, 'US', null, 'The Imposter', 'Documental que explora el caso de la desaparición de Nicholas Barclay, un niño de 13 años de Texas.', 2012, 1, 'PG-13', 1);
INSERT INTO documental VALUES (26, 'US', null, 'The Thin Blue Line', 'Documental que explora el caso de Randall Dale Adams, un hombre que fue acusado de asesinar a un policía.', 1988, 1, 'PG-13', 1);
INSERT INTO documental VALUES (27, 'US', null, 'The Jinx: The Life and Deaths of Robert Durst', 'Documental que explora la vida de Robert Durst, un multimillonario que fue acusado de asesinar a tres personas.', 2015, 1, 'PG-13', 1);
INSERT INTO documental VALUES (26, 'US', null, 'The Thin Blue Line', 'Documental que explora el caso de Randall Dale Adams, un hombre que fue acusado de asesinar a un policía.', 1988, 1, 'PG-13', 1);
INSERT INTO documental VALUES (27, 'US', null, 'The Jinx: The Life and Deaths of Robert Durst', 'Documental que explora la vida de Robert Durst, un multimillonario que fue acusado de asesinar a tres personas.', 2015, 1, 'PG-13', 1);
INSERT INTO documental VALUES (28, 'US', null, 'Cowspiracy: The Sustainability Secret', 'Documental que explora el impacto ambiental de la industria de la carne.', 2014, 1, 'PG-13', 1);
INSERT INTO documental VALUES (29, 'US', null, 'The Cove', 'Documental que explora la caza de delfines en Taiji, Japón.', 2009, 1, 'PG-13', 1);
